let wakeLock=null;const requestWakeLock=async()=>{try{wakeLock=await navigator.wakeLock.request("screen")}catch(e){}};$(function(){requestWakeLock()});const handleVisibilityChange=async()=>{null!==wakeLock&&"visible"===document.visibilityState&&await requestWakeLock()};function clickGenPassword(e,n,t){var a=generatePassword(30);$("input#password").val(a),$("input#password_confirmation").val(a);copyTextToClipboard(a);$.alert({title:e,content:n,escapeKey:"cancel",backgroundDismiss:!0,onOpenBefore:function(){},onClose:function(){},buttons:{cancel:{text:t}}})}document.addEventListener("visibilitychange",handleVisibilityChange);